                height = width * aspect;
              }
              canvasElement.width = width;
              canvasElement.height = height;
              await objectron.send({image: input});
            },
        examples,
      }),
      new controls.Toggle({title: 'Selfie Mode', field: 'selfieMode'}),
      new controls.DropDownControl({
        title: 'Model',
        field: 'modelName',
        options: [
          {
            name: 'Shoe',
